import React from 'react';
import { StyleSheet, View, Text, Image } from 'react-native';
import {useDispatch, useSelector} from "react-redux";
import { MediumAppText, BoldAppText } from '../styles/text'
import Divider from './Divider'
import { VictoryArea, VictoryChart, VictoryAxis } from 'victory-native';
import _ from 'lodash';
import { DateTime } from 'luxon'
import {Defs, Ellipse, LinearGradient, Stop } from "react-native-svg";


function MoodVisuals () {

  const historicalData = useSelector((state) => state.historicalData);
  const moodsData = _.map(historicalData, el => el.moods) 

  function create (array) {
    let obj = {}
    for (let i of array) {
      for (let j of i) {
        if (j in Object.keys(obj)) {
          obj[j] = obj[j]+1
        } else {
          obj[j]= 0
        }
      }
    }
    return obj
  }

  const ok= {
    "bored": 0,
    "down": 0,
    "elated": 0,
    "happy": 0,
    "joyful": 0,
    "sad": 0,
    "stressed": 0,
    "tired": 0,
  }
  const obj = create(moodsData)
  console.log(Object.keys(ok))

  return (
    <View style={styles.container}>
      <Text>MoodVissuals</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
  },
});



export default MoodVisuals;
